import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav className="navbar">
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        {/* Add more links here if needed */}
      </ul>
    </nav>
  );
}

export default Navbar;
